intents = discord.Intents.default()
intents.typing = True
intents.messages = True
intents.message_content = True
bot = discord.Client(intents=intents)
@bot.event
async def on_ready():
    print(f'Conectado como {bot.user}')

@bot.event
async def on_message(message):
    if message.author == bot.user:
        return

    msg_content = message.content.lower()

    if msg_content.startswith("$"):
                
        query = msg_content[1:].strip()  
        response = None

        if query.isdigit():
            index = int(query) - 1 
            if 0 <= index < len(IMAGENS):
                personagem = IMAGENS[index]
                response = (
                    f"**Ranking position:** {index + 1}\n"
                    f"**Name:** {personagem['name']}\n"
                    f"**Level:** {personagem['Nivel']}\n"
                    f"**Version:** {personagem.get('Serie', 'N/A')}"
                )
                await message.channel.send(response)
                await message.channel.send(personagem["img"])
            else:
                await message.channel.send("Unranked number")
            return
        
        for i, personagem in enumerate(IMAGENS):
            if query == personagem["name"].lower(): 
                response = (
                    f"**Ranking position:** {i + 1}\n"
                    f"**Name:** {personagem['name']}\n"
                    f"**Level:** {personagem['Nivel']}\n"
                    f"**Version:** {personagem.get('Serie', 'N/A')}"
                )
                await message.channel.send(response)
                await message.channel.send(personagem["img"])
                return

        for i, personagem in enumerate(IMAGENS):
            if query in personagem["name"].lower():
                response = (
                    f"**Ranking position:** {i + 1}\n"
                    f"**Name:** {personagem['name']}\n"
                    f"**Level:** {personagem['Nivel']}\n"
                    f"**Version:** {personagem.get('Serie', 'N/A')}"
                )
                await message.channel.send(response)
                await message.channel.send(personagem["img"])
                return
        for i, personagem in enumerate(IMAGENS):
            if query in personagem.get("dubName", "").lower(): 
                response = (
                    f"**Ranking position:** {i + 1}\n"
                    f"**Name:** {personagem['name']}\n"
                    f"**Level:** {personagem['Nivel']}\n"
                    f"**Version:** {personagem.get('Serie', 'N/A')}"
                )
                await message.channel.send(response)
                await message.channel.send(personagem["img"])
                return

        if " " in query:
            params = query.split()
            if len(params) == 2 and all(p.isdigit() for p in params): 
                start, end = sorted(map(int, params))  
                if 1 <= start <= len(IMAGENS) and 1 <= end <= len(IMAGENS): 
                    response = "**Characters in range:**\n"
                    for i in range(start - 1, end):  
                        personagem = IMAGENS[i]
                        response += f"**Ranking position:** {i + 1} - {personagem['name']}\n"
                    await message.channel.send(response)
                else:
                    await message.channel.send("Out of range")
                return
            else:
                await message.channel.send("Please provide 2 valid and separated numbers")
                return

        if response is None:
            await message.channel.send("Character not found in the ranking")

